import React from "react";

const AddNewButton = props => {
  const PopUp = () => {
    return window.prompt("sometext", "defaultText");
  };

  return (
    <button
      className="ui icon button"
      onClick={() => this.props.newKey(PopUp())}
    >
      <i className="plus icon" />
    </button>
  );
};

export default AddNewButton;
